    //     <Route path="/TeacherLeaderboard" element={<TeacherLeaderboard/>}></Route>
    //     <Route path="/StudentPointHistory" element={<StudentPointsHistory/>}></Route>
    //     <Route path="/StudentReward" element={<StudentReward/>}></Route>
    //   </Routes>
    // </BrowserRouter>
    <div className="App">
      <ReactNotification />
      <RewardAdmin />
    </div>
  );
}

export default App;
